var timer = null;
function init() {
    imgObj = document.getElementById('thank');
    imgObj.style.position = 'absolute';
    imgObj.style.top = '240px';
    imgObj.style.left = '100px';
    const selectElement = document.querySelector('.nieve');

selectElement.addEventListener('change', (event) => {
    console.log(event.target.value);
    var thank = document.getElementById("thank");
    if(event.target.value == "katarina")
    {
        thank.src="data:image/jpeg;base64,";
    }
    if(event.target.value == "yasuo")
    {
        thank.src="data:image/jpeg;base64,";
    }
    if(event.target.value == "ashe")
    {
        thank.src="data:image/jpeg;base64,";
    }

});
}
function right() {
    clearInterval(timer);
    var thank = document.getElementById("thank");
    var init = Number(thank.style.left.slice(0, -2));
    timer = setInterval(function () {
        var pos = thank.style.left;
        pos = Number(pos.slice(0, -2));
        console.log(pos);
        pos++;
        thank.style.left = pos + "px";
        if (init + 200 == pos) clearInterval(timer);
    }, 25);
};
function up() {
    clearInterval(timer);
    var thank = document.getElementById("thank");
    var init = Number(thank.style.top.slice(0, -2));
    timer = setInterval(function () {
        var pos = thank.style.top;
        pos = Number(pos.slice(0, -2));
        console.log(pos);
        pos--;
        thank.style.top = pos + "px";
        if (init - pos == 200) clearInterval(timer);
    }, 25);
};
